import React from 'react'
import { useDispatch } from 'react-redux';

import { deleteNavItem } from '../navBarList/navBarSlice'

import '../navBarItem/navBarItemStyle.css'

const NavBarItem = ({ url, navItemKey }) => {
  const dispatch = useDispatch()

  const onClickDelete = () => {
    dispatch(deleteNavItem(navItemKey)) // deleteNavItem needs to be passes the key of the 
  }

  return (
    <div className='navBarItem'>
        <button onClick={onClickDelete} className='navBarItemBinBtn'></button>
        <label className='navBarItemLabel' text={url}></label>
    </div>
  )
}

export default NavBarItem
